insert  into `depoimentos`(`id`,`id_foto`,`texto`,`tipo_franqueado`,`status`,`created_at`,`updated_at`,`deleted_at`) values 
(1,306,'<p>\"O carrinho que alugamos na Facilitrip facilitou muito nosso dia a dia, principalmente nas saídas com o bebê, pois o que eu tinha além de ser bem mais bruto, ocupava muito espaço no carro para transportar. Já o da Facilitrip, conseguimos guardar com facilidade, e fica bem mais compacto, otimizando lugar na nossa mala. Além, de ter um designer super bonito também. Amamos!!\"</p><p><b>- Ana Menezes</b></p>','trip','ativo','2024-06-14 17:06:31','2024-09-26 15:08:46',NULL),
(2,307,'<p>\"Alugamos a cadeirinha de alimentação e o berço para levar para nossa viagem em família e foi incrível! A cadeira facilitou na hora das refeições pois um sempre tinha que comer depois pra poder segurar a Nick e o bercinho, sem palavras, estava preocupada dela cair da cama durante as noites no hotel, e com bercinho não tivemos problema.&nbsp; Sou apaixonada na Facilitrip!\"</p><p><b>- Karine Costa</b><br><br></p>','trip','ativo','2024-06-14 17:12:08','2024-09-26 15:11:02',NULL),
(3,NULL,'<p>\"Foi a primeira vez que aluguei brinquedos para uma viagem, e foi uma escolha incrível.\"</p><p><b>- Sandra B</b></p>','toy','ativo','2024-06-14 17:13:21','2024-09-13 20:42:45','2024-09-13 20:42:45'),
(4,NULL,'<p>\"Super recomendo a Facilitrip, alugamos um carrinho de bebê e uma cadeirinha de carro para nossa viagem e ficamos muito satisfeitos com a qualidade e o atendimento. Excelente serviço!\"</p><p><b>- Beatriz K.</b></p>','trip','ativo','2024-06-14 17:14:21','2024-09-26 15:08:53','2024-09-26 15:08:53'),
(5,NULL,'<p>\"Aluguei brinquedos para meus filhos e eles se divertiram o tempo todo, e isso tornou nossa viagem muito mais agradável.\"</p><p><b>- Mariana S.</b></p>','toy','ativo','2024-06-14 17:15:57','2024-09-13 20:42:55','2024-09-13 20:42:55'),
(6,308,'<p>\"Há alguns dias, aluguei um carrinho de passeio para levar na viagem com meu pequeno e não poderia estar mais grata por ter conhecido a Facilitrip! Imagina se eu tivesse que carregar ele no colo durante todo o percurso? ? Gostei muito!\"<br><br><b>- Alana C.</b><br></p>','trip','ativo','2024-09-26 17:49:21','2024-09-26 19:00:01',NULL),
(7,309,'<p>\"Aluguei um bercinho com a Facilitrip e ajudou muito as nossas noites durante a viagem em família. Foi sensacional. Recebi tudo higienizado e foi muito fácil de montar! Adorei.\"<br><br><b>- Taiane F.</b><br></p>','trip','ativo','2024-09-26 18:23:26','2024-09-26 18:24:08',NULL),
(8,311,'<p>\"Aluguei o Carrinho para facilitar nossos passeios e foi incrível! Chegou bem higienizado e embalado. Melhor empresa de locação de acessórios para bebês, super indico.\"</p><p><b>- Carol M.</b></p>','trip','ativo','2024-09-26 19:07:56','2024-09-26 19:08:29',NULL);
insert  into `duvidas_frequentes`(`id`,`pergunta`,`resposta`,`tipo_franqueado`,`status`,`created_at`,`updated_at`,`deleted_at`) values 
(3,'Vocês fazem entrega e retirada?','<p><span class=\"OYPEnA font-feature-liga-off font-feature-clig-off font-feature-calt-off text-decoration-none text-strikethrough-none\" style=\"font-kerning: none;\">Fazemos sim! Entre em contato conosco para verificar se atendemos sua região.</span><br></p>','trip','ativo','2024-06-14 17:19:25','2024-09-18 19:38:17',NULL),
(4,'Vocês possuem loja física?','<p><span class=\"OYPEnA font-feature-liga-off font-feature-clig-off font-feature-calt-off text-decoration-none text-strikethrough-none\" style=\"font-kerning: none;\">Sim, temos uma loja física em São Paulo e diversos pontos de distribuição espalhados pelo país.</span><br></p>','trip','ativo','2024-06-14 17:22:05','2024-09-18 19:39:54',NULL),
(5,'O que acontece se algum item quebrar?','<span class=\"OYPEnA font-feature-liga-off font-feature-clig-off font-feature-calt-off text-decoration-none text-strikethrough-none\" style=\"font-kerning: none;\">Selecionamos as melhores marcas, que oferecem assistência técnica para garantir a durabilidade e a melhor experiência. Entretanto, imprevistos podem ocorrer, e na maioria das vezes, conseguimos solucionar com pequenos reparos.</span>','trip','ativo','2024-06-14 17:27:06','2024-09-18 19:39:09',NULL),
(6,'Posso alugar somente por um dia?','<p><span class=\"OYPEnA font-feature-liga-off font-feature-clig-off font-feature-calt-off text-decoration-none text-strikethrough-none\" style=\"font-kerning: none;\">Sim, é possível alugar por apenas um dia, mas cobramos o valor mínimo de 3 diárias para cobrir os custos de manutenção e higienização.</span><br></p>','trip','ativo','2024-06-14 17:27:30','2024-09-18 19:40:18',NULL),
(7,'E como funciona a entrega?','<p><span class=\"OYPEnA font-feature-liga-off font-feature-clig-off font-feature-calt-off text-decoration-none text-strikethrough-none\" style=\"font-kerning: none;\">A cobrança da entrega é feita conforme sua localização. Para saber os valores e prazos, entre em contato conosco agora!</span><br></p>','trip','ativo','2024-06-14 17:28:59','2024-09-18 19:39:32',NULL);
