(12,'Carrinho de Bebê Legend','carrinho-de-bebe-legend-12',7,'Infanti','O carrinho Legend da Infanti possui estrutura leve de\r\nalumínio, com acabamento cromado, para um visual\r\nmoderno e tecidos macios com toque diferenciado. O\r\nfechamento é compacto e rápido, feito com apenas uma das\r\nmãos e possui também alça para carregar. Toda a praticidade\r\nque desejamos com o conforto que o bebê merece.\r\nFechamento compacto com alça para carregar. Capota ampla\r\ncom aba de sol, visor de imã e proteção UV50+. Abertura\r\ntraseira super ampla com zíper e tela de proteção.\r\nAcompanha mosquiteiro para proteção contra insetos e que\r\nbarra luz excessiva. Barra frontal com abertura central.\r\nAcopla ao Bebê Conforto Fly Infanti.','36',100.00,'15',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-19 13:59:07','2024-06-26 18:12:58','2024-06-26 18:12:58'),
(13,'Carrinho de Bebê Lucca','carrinho-de-bebe-lucca-13',7,'Infanti','O carrinho Lucca é um companheiro versátil e confortável para pais e bebês.\r\nProjetado para uso desde o nascimento até por volta dos 4 anos, oferece um\r\nencosto reclinável em múltiplas posições para acompanhar o crescimento do\r\nbebê. Com rodas dianteiras e traseiras com suspensão, proporciona um passeio\r\nsuave em qualquer fase. A capota com proteção UV50+ e janela de ventilação\r\nmantém o bebê protegido e confortável, enquanto os pais podem ficar de olho\r\natravés do visor na capota. Com um porta-copos conveniente para os adultos e\r\num freio de único ponto de acionamento, oferece praticidade no dia a dia. Além\r\ndisso, possui uma barra frontal forrada e removível para maior conforto das\r\nmãos do bebê, e uma bolsa de transporte para facilitar o transporte. O carrinho\r\nLucca é uma escolha inteligente e confortável para famílias em movimento.',NULL,120.00,NULL,NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-19 14:49:17','2024-06-26 18:13:02','2024-06-26 18:12:58'),
(14,'Banheira Rosa P - Baby Pil','banheira-rosa-p-baby-pil-14',8,'Baby pil','<div>A banheira dobrável da Baby Pil possui dreno duplo tornando o esvaziamento rápido e fácil. Conta com um plug de sílica gel sensível que muda de cor conforme a temperatura da água, evitando que fique muito quente ou fria [Acima de 37 graus fica vermelho e abaixo de 37 fica azul]. A banheira possui pé dobrável antiderrapante e suporta até 20 litros de água. É maleável e resistente. Possui 2 regulagens de altura. A primeira para ser utilizada desde recém-nascido até os 10 meses e a segunda mais funda a partir de 10 meses recomendado até os 03 anos de idade.&nbsp;<br></div><div><br></div>','0 a 3 anos',100.00,'80',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-19 19:46:39','2024-07-19 18:33:51','2024-07-19 18:33:51'),
(15,'Banheira do bebê dobrável Banheira turística Dreno','banheira-do-bebe-dobravel-banheira-turistica-dreno-15',8,'Ecotoys','Dedicado às crianças desde os primeiros dias de vida Construção estável (plástico, silicone) Tampa de drenagem que muda de cor quando a água está muito quente&nbsp;','0 a 12 meses',100.00,NULL,NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 17:31:10','2024-07-19 18:33:55','2024-07-19 18:33:55'),
