(17,'Banheira do bebê dobrável Banheira turística Dreno','banheira-do-bebe-dobravel-banheira-turistica-dreno-17',8,'Ecotoys','Dedicado às crianças desde os primeiros dias de vida Construção estável (plástico, silicone) Tampa de drenagem que muda de cor quando a água está muito quente&nbsp;','0 a 12 meses',100.00,NULL,NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 17:31:15','2024-06-26 17:49:53','2024-06-26 17:49:53'),
