(19,'Banheira dobrável Comfy & Safe Acqua Green - Safety 1st','banheira-dobravel-comfy-safe-acqua-green-safety-1st-19',8,'Safety 1st','Seu tamanho é ideal para deixá-la atrás da porta sem ocupar muito espação e seus pezinhos dobráveis são práticos e a deixa fixa no chão com segurança. Ela já acompanha um suporte para recém nascidos e é indicada para bebês de até 30kg, ou seja, irá acompanhar o crescimento do seu filho. A banheira Comfy and Safe ainda possui uma válvula de escoamento, porta objetos e porta chuveirinho, na cor verde ela é perfeita para deixar o banho do bebê seguro e confortável.',NULL,100.00,'30',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 17:56:39','2024-07-19 18:33:58','2024-07-19 18:33:58'),
(20,'Safety Smart Vision 110V/220V branco 3.2 polegadas','safety-smart-vision-110v220v-branco-32-polegadas-20',13,'Safety 1st','Desenvolvida com todo cuidado para seu pequeno(a)!\r\nTela de 3.2’’, alcance de até 260m, visão noturna, tecnologia Talk Back, bateria de longa duração e\r\nmuito mais!\r\nA Smart Vision da Safety 1st é a babá eletrônica para quem procura tranquilidade e segurança, dia\r\ne noite. Foi pensada para ter seu filho(a) sempre\r\ncom você, independente do ambiente da casa em que esteja. Possui um alcance de até 260m,\r\nconexão Wireless de 2.4G, bateria recarregável de longa\r\nduração, visão noturna e a tecnologia Talk Back, que permite que você fale com seu bebê à\r\ndistância.\r\nFocada em cuidar do seu bebê, ela possui sensor de temperatura que mede quantos graus está no\r\nambiente, 8 canções de ninar para deixar o soninho\r\nmais gostoso e acionamento por voz, que liga o monitor ao menor ruído. Tudo isso em seu monitor\r\ncolorido de 3.2’’.\r\nSeu design é clean e moderno , e vai bem com qualquer ambiente. Possui suporte para vários\r\nidiomas e ainda é possível ajustar o alarme para um alerta\r\nem horários específicos.',NULL,100.00,NULL,NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 18:25:10','2024-07-19 18:34:01','2024-07-19 18:34:01'),
(21,'Conectores para carrinhos - Double (Kiddo)','conectores-para-carrinhos-double-kiddo-21',7,'Kiddo','transforma dois carrinhos individuais em carrinho duplo.\r\nfacilita o manuseio de dois carrinhos ao mesmo tempo. para fechar os carrinhos, não precisa\r\ndesconectar',NULL,100.00,NULL,NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 18:36:09','2024-07-19 18:34:04','2024-07-19 18:34:04'),
(22,'Stroller Ride Board Universal Standing Removível Multi','stroller-ride-board-universal-standing-removivel-multi-22',7,'Generic','<div>: A prancha planadora Rider é projetada com um sistema de encaixe universal</div><div>que se adapta a quase todos os carrinhos de bebê, eliminando questões de compatibilidade.</div><div>Ampla faixa etária: a prancha planadora de carrinho é adequada para crianças de 2 a 7 anos,</div><div>pesando até 25 kg (55 libras). A prancha se adapta perfeitamente a crianças de várias faixas</div><div>etárias. Vários modos: o assento removível permite que as crianças se sentem ou fiquem em pé.</div><div>Quando não estiver em uso, a prancha pode ser convenientemente armazenada usando a alça de</div><div>armazenamento embutida. Versátil em vários cenários: seja fazendo compras, indo ao</div><div>supermercado, passeando no parque ou viajando, a instalação da prancha de carrinho permite que</div><div>seu filho se mova com mais liberdade e se divirta mais. ABS: cuidadosamente projetado e feito</div><div>com materiais ABS, garantindo uma experiência de usuário segura, estável e confortável. Oferecer</div><div>o melhor para seu filho significa proporcionar a ele um ambiente feliz para crescer.</div><div><br></div>','2 a 7 anos',100.00,'25',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 18:40:24','2024-07-19 18:34:07','2024-07-19 18:34:07'),
(23,'Stroller Ride Board Universal Standing Removível Multi','stroller-ride-board-universal-standing-removivel-multi-23',7,'Generic','<div>: A prancha planadora Rider é projetada com um sistema de encaixe universal</div><div>que se adapta a quase todos os carrinhos de bebê, eliminando questões de compatibilidade.</div><div>Ampla faixa etária: a prancha planadora de carrinho é adequada para crianças de 2 a 7 anos,</div><div>pesando até 25 kg (55 libras). A prancha se adapta perfeitamente a crianças de várias faixas</div><div>etárias. Vários modos: o assento removível permite que as crianças se sentem ou fiquem em pé.</div><div>Quando não estiver em uso, a prancha pode ser convenientemente armazenada usando a alça de</div><div>armazenamento embutida. Versátil em vários cenários: seja fazendo compras, indo ao</div><div>supermercado, passeando no parque ou viajando, a instalação da prancha de carrinho permite que</div><div>seu filho se mova com mais liberdade e se divirta mais. ABS: cuidadosamente projetado e feito</div><div>com materiais ABS, garantindo uma experiência de usuário segura, estável e confortável. Oferecer</div><div>o melhor para seu filho significa proporcionar a ele um ambiente feliz para crescer.</div><div><br></div>','2 a 7 anos',100.00,'25',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 18:43:29','2024-06-28 18:02:06','2024-06-28 18:02:06'),
(24,'Carrinho De Bebê De Passeio Maxi-cosi Eva Ts Trio','carrinho-de-bebe-de-passeio-maxi-cosi-eva-ts-trio-24',7,'Maxi-Cosi','<div>A cor principal é cinza.</div><div>Carrinho de bebê e base para o carro.</div><div>Com 3 posições para reclinar.</div><div>Com freios, capota retrátil e sistema de suspensão.</div><div>Possui capota com visor.</div><div>Possui tecido removível.</div><div>Possui tiras ajustáveis.</div><div>Acessórios incluídos: almofadas</div><div><br></div>',NULL,100.00,'15',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 18:52:09','2024-06-26 19:19:41','2024-06-26 19:19:41'),
(25,'Carrinho De Bebê De Paseio Maxi-cosi Eva Ts Trio','carrinho-de-bebe-de-paseio-maxi-cosi-eva-ts-trio-25',7,'Maxi-Cosi','<div>A cor principal é cinza.</div><div>Carrinho de bebê e base para o carro.</div><div>Com 3 posições para reclinar.</div><div>Dimensões do carrinho aberto: 49 cm de largura x 106 cm de altura.</div><div>Com freios, capota retrátil e sistema de suspensão.</div><div>Possui capota com visor.</div><div>Possui tecido removível.</div><div>Possui tiras ajustáveis.</div><div>Acessórios incluídos: almofadas</div><div><br></div>',NULL,100.00,'15',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 18:56:23','2024-07-19 18:34:11','2024-07-19 18:34:11'),
(26,'Carrinho Nuna Pepp Luxx','carrinho-nuna-pepp-luxx-26',7,'Luxx','<font style=\"box-sizing: inherit; color: rgb(68, 68, 68); font-family: Lato, sans-serif; font-size: 17.28px; text-align: justify; vertical-align: inherit;\">O famoso empurrão com uma mão da linha Pepp é conseguido graças ao seu formato particular com centro de gravidade mais baixo. As rodas mais largas são equipadas com suspensão e boas até para as calçadas irregulares da cidade, são dobradas na frente para melhor estabilidade. O próprio sistema de suspensão também é complementado com a flexibilidade natural do chassi em forma de L.</font>','0 a 30 meses',100.00,'18',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 19:06:51','2024-07-19 18:34:15','2024-07-19 18:34:15'),
(27,'Conjunto Travel System Legend Trio Fly Cinza - Infanti','conjunto-travel-system-legend-trio-fly-cinza-infanti-27',7,'Infanti','<span style=\"color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\">O conjunto Travel System Legend Ts Trio Fly da Infanti é composto pelo bebê conforto Fly, base veicular Elos e o carrinho Legend, com estrutura leve de alumínio, acabamento cromado, para um visual moderno e tecidos macios com toque diferenciado. O fechamento é compacto e rápido, feito com apenas uma das mãos e possui também alça para carregar. Toda a praticidade que desejamos com o conforto que o bebê merece. O conforto extra é garantido pela forração do assento, em tecido com espuma, macio e respirável, e 3 posições de inclinação para os bebês recém-nascidos e maiores. A capota com proteção UV50+, é bem ampla, com quebra-sol e tem visor com fechamento em imã, confeccionada em tecido esportivo, que não amassa e é muito macio ao toque, tem bolso com zíper para pequenos objetos, com capacidade para 2 kg e mais uma abertura gigante, com zíper e tela, na parte traseira, para visualizar facilmente todo o interior do carrinho, além de deixar mais arejado e fresquinho para o bebê quando necessário.</span>',NULL,100.00,'13',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 19:16:42','2024-07-19 18:34:37','2024-07-19 18:34:37'),
(28,'Carrinho de Bebê DuoLee Galzerano','carrinho-de-bebe-duolee-galzerano-28',7,'Galzerano','<div>O Duolee é um carrinho para gêmeos ou crianças de idades diferentes prático, moderno, sofisticado e fácil de transportar. Oferece conforto, segurança e a qualidade que o seu bebê merece.<br></div>',NULL,100.00,'15',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 19:42:05','2024-07-19 18:34:41','2024-07-19 18:34:41'),
(29,'Ingenuity Multi Assento Baby Base 2 Em 1','ingenuity-multi-assento-baby-base-2-em-1-29',12,'Ingenuity','<p>A Cadeira de Alimentação Baby Base 2 em 1 da Ingenuity é ideal para os momentos de refeição&nbsp;<span style=\"font-size: 1rem; background-color: var(--bs-card-bg); text-align: var(--bs-body-text-align);\">e também para os momentos de atividades, mantendo o bebê sempre seguro e confortável.</span></p><p>Recomendado para uso a partir de 6 meses até 36 meses ou 15Kg.</p><p>O produto possui 2 modos de uso: no chão ou encaixado em uma cadeira de jantar para uso&nbsp;<span style=\"font-size: 1rem; background-color: var(--bs-card-bg); text-align: var(--bs-body-text-align);\">como assento de elevação.</span></p><p>A base para bebês da Ingenuity pode ser facilmente acoplada às cadeiras para que seu bebê&nbsp;<span style=\"font-size: 1rem; background-color: var(--bs-card-bg); text-align: var(--bs-body-text-align);\">possa sentar-se mais alto e participar dos momentos das refeições em família, ou também&nbsp;</span><span style=\"font-size: 1rem; background-color: var(--bs-card-bg); text-align: var(--bs-body-text-align);\">funciona como uma cadeira no chão durante as brincadeiras. Mantendo o bebê confortável e&nbsp;</span><span style=\"font-size: 1rem; background-color: var(--bs-card-bg); text-align: var(--bs-body-text-align);\">seguro!</span></p><p>Além disso, acompanha sua própria bandeja, que pode ser removida quando não está em uso e&nbsp;<span style=\"font-size: 1rem; background-color: var(--bs-card-bg); text-align: var(--bs-body-text-align);\">facilmente encaixada abaixo do assento, facilitando o armazenamento e transporte.</span></p><p>A inserção de espuma oferece amortecimento e conforto extra para o bebê e pode ser removida&nbsp;<span style=\"font-size: 1rem; background-color: var(--bs-card-bg); text-align: var(--bs-body-text-align);\">para que o assento permaneça confortável e se ajuste à medida que a criança cresce.</span></p><p>            \r\n        </p>','6 meses a 4 anos',100.00,'15',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 20:03:11','2024-07-19 18:34:44','2024-07-19 18:34:44'),
(30,'Cadeira Alimentação Multi Assento Bumbo','cadeira-alimentacao-multi-assento-bumbo-30',12,'Bumbo','<div>O multi assento possui altura ajustável, almofada de espuma macia removível&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">que pode ser armazenada dentro do assento, cinto de segurança de 3 pontas&nbsp;</span><span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">que DEVE ser sempre usado, cinto retrátil para fixar o assento na cadeira,</span></div><div>bandeja removível que pode ser guardada no próprio multi assento e com 2&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">ajustes de altura para acomodar seu filho em crescimento.</span></div><div>Com 3 opções de uso de acordo com a idade da criança.</div><div>1) assento de chão, para crianças que já sentam eretas, com uso da bandeja ou&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">não.</span></div><div>2) assento de alimentação com a bandeja.</div><div>3) cadeira de alimentação, fixo em cadeira comum que adapta crianças&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">maiores à mesa sendo que a almofada poderá ser removida ou como booster.</span></div>','6 meses a 3 anos',100.00,'15',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 20:10:56','2024-06-26 20:12:49','2024-06-26 20:12:49'),
(31,'Cadeira Alimentação Multi Assento Bumbo','cadeira-alimentacao-multi-assento-bumbo-31',12,'Bumbo','<div>O multi assento possui altura ajustável, almofada de espuma macia removível&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">que pode ser armazenada dentro do assento, cinto de segurança de 3 pontas&nbsp;</span><span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">que DEVE ser sempre usado, cinto retrátil para fixar o assento na cadeira,</span></div><div>bandeja removível que pode ser guardada no próprio multi assento e com 2&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">ajustes de altura para acomodar seu filho em crescimento.</span></div><div>Com 3 opções de uso de acordo com a idade da criança.</div><div>1) assento de chão, para crianças que já sentam eretas, com uso da bandeja ou&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">não.</span></div><div>2) assento de alimentação com a bandeja.</div><div>3) cadeira de alimentação, fixo em cadeira comum que adapta crianças&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">maiores à mesa sendo que a almofada poderá ser removida ou como booster.</span></div>','6 meses a 3 anos',100.00,'15',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 20:10:56','2024-06-26 20:12:41','2024-06-26 20:12:41'),
(32,'Cadeira Alimentação Multi Assento Bumbo','cadeira-alimentacao-multi-assento-bumbo-32',12,'Bumbo','<div>O multi assento possui altura ajustável, almofada de espuma macia removível&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">que pode ser armazenada dentro do assento, cinto de segurança de 3 pontas&nbsp;</span><span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">que DEVE ser sempre usado, cinto retrátil para fixar o assento na cadeira,</span></div><div>bandeja removível que pode ser guardada no próprio multi assento e com 2&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">ajustes de altura para acomodar seu filho em crescimento.</span></div><div>Com 3 opções de uso de acordo com a idade da criança.</div><div>1) assento de chão, para crianças que já sentam eretas, com uso da bandeja ou&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">não.</span></div><div>2) assento de alimentação com a bandeja.</div><div>3) cadeira de alimentação, fixo em cadeira comum que adapta crianças&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">maiores à mesa sendo que a almofada poderá ser removida ou como booster.</span></div>','6 meses a 3 anos',100.00,'15',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-26 20:12:24','2024-07-19 18:34:23','2024-07-19 18:34:23'),
(33,'Cadeirinha de Assento - Bumbo','cadeirinha-de-assento-bumbo-33',13,'Bumbo','O Bumbo é uma inovadora cadeirinha para bebês, proporcionando uma posição sentada segura para os pequenos que ainda não conseguem fazê-lo sozinhos. Com um design que abraça a criança de forma confortável, permite movimento livre para os braços e pernas, estimulando sua curiosidade e desenvolvimento. Feito de espuma leve e antialérgica, é fácil de transportar e limpar, ideal para alimentação e viagens. Projetado por especialistas para garantir o posicionamento adequado da coluna do bebê. Importante ressaltar que não deve ser colocado em superfícies elevadas, como cadeiras, sofás ou mesas.','6 a 12 meses',100.00,NULL,NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 13:50:18','2024-07-19 18:34:19','2024-07-19 18:34:19'),
(34,'Cadeira de Alimentação Portátil Toast','cadeira-de-alimentacao-portatil-toast-34',12,'Infanti','Portátil e ultracompacta, pode ser levada em viagens ou passeios e acoplada em cadeiras comuns de adulto. Regulagem de altura e capa protetora para maior conforto. Adapta-se facilmente as cadeiras comuns de adulto, com tiras de fixação para maior segurança, ajustável em 3 posições de altura, cintos de segurança para o bebê, bandeja removível e fechamento muito fácil e ultra-compacto com alça para transporte. Capa protetora do assento, acolchoada para maior conforto, impermeável, facilmente removível e lavável.',NULL,100.00,NULL,NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 13:54:25','2024-07-19 18:34:33','2024-07-19 18:34:33'),
(35,'Bebê conforto Citi com Base Máxi Cosi','bebe-conforto-citi-com-base-maxi-cosi-35',11,'Maxi-Cosi','O Bebê conforto com base Citi é um produto que preza pela proteção e bem-estar do bebê. Leve e fácil de carregar, ele possui cinto de segurança de 3 pontos, protetores de ombros e é regulável em duas alturas. Ele também possui redutor de assento e cabeça macios e acolchoados, com capota removível e em tecido esportivo que não amassa. Este bebê conforto Maxi-Cosi Citi suporta até 13 kg, permitindo que seu bebê use mesmo vestindo roupas mais densas. É um equipamento muito seguro, que conta, ainda, com manual de instruções, para que não haja dúvidas na hora de utilizá-lo e mesmo incluindo a base para bebê conforto, ele pode ser utilizado sozinho. Mas saiba que a base garante mais estabilidade e segurança durante o deslocamento, principalmente em carros grandes, e não ocupa muito espaço.',NULL,100.00,'13',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 14:04:26','2024-07-19 18:34:26','2024-07-19 18:34:26'),
(36,'Cadeirinha de automóvel Alfa Voyage','cadeirinha-de-automovel-alfa-voyage-36',9,'Voyage','<p class=\"MsoNormal\">A Cadeira para Auto Alfa da Voyage é versátil e acompanha o\r\ncrescimento da criança. Possui almofadas redutoras removíveis para os menores e\r\nopção de assento de elevação (booster) para os maiores. Conta também com apoio\r\nde cabeça ajustável em altura, protetores de ombro e apoios para os braços. Sua\r\ncapa pode ser facilmente removida e lavada na máquina, enquanto as partes\r\nplásticas podem ser limpas com esponja e detergente neutro, facilitando a\r\nhigienização. Pode ser utilizada em três estágios diferentes: para crianças até\r\n10 kg ou 70 cm ou 9 meses de idade, recomendando-se a instalação voltada para\r\ntrás no banco traseiro do automóvel; para crianças até 13 kg ou 80 cm ou 1 ano\r\nde idade, também com instalação voltada para trás no banco traseiro; e para\r\ncrianças de 9 a 18 kg ou até 1,6 ano de idade, instalada somente no banco\r\ntraseiro, sempre com a criança presa pelos cintos da cadeirinha e do automóvel.<o:p></o:p></p>','0 a 24 meses',100.00,'36',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 14:19:28','2024-07-19 18:34:29','2024-07-19 18:34:29'),
(37,'Bebê Conforto Grid Galzerano','bebe-conforto-grid-galzerano-37',11,'Galzerano','O Bebê Conforto Grid da Galzerano é o item ideal para o transporte do bebê. De fácil instalação, o Grid é indicado para crianças do grupo 0+, do nascimento até 13 kg. Prático e confortável para o dia a dia, ele possui o melhor custo benefício e, além disso, acopla nos carrinhos com facilidade.',NULL,100.00,'13',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 14:27:08','2024-07-19 18:34:47','2024-07-19 18:34:47'),
(38,'Bebê Conforto Fly Infanti','bebe-conforto-fly-infanti-38',11,'Infanti','O Bebê conforto Fly Infanti é extremamente confortável, feito em tecidos especiais e com toque muito mais macio. A Alça possui 4 posições de ajuste para 5 modos de uso: para transportar, instalar no veículo, modo fixo, balanço ou acoplar no carrinho. O seu modo de ajuste para as posições fixo ou balanço permite o uso como uma cadeira de descanso ou bouncer dentro de casa.','0 a 1 ano',100.00,'13',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 14:39:30','2024-07-19 18:34:51','2024-07-19 18:34:51'),
(39,'Cadeirinha Automóvel Tour Cosco','cadeirinha-automovel-tour-cosco-39',9,'Cosco','<p class=\"MsoNormal\">Cadeirinha que acompanha o crescimento da criança, redutores\r\nreposicionáveis para os menores, apoio de cabeça ajustável em altura e assento\r\nde elevação para os maiores. Capa da cadeira lavável. A cadeirinha Tour da\r\nCosco atende crianças dos 9 aos 36 kg, aproximadamente de 1 aos 10 anos de\r\nidade. Com almofadas redutoras para acomodar melhor as crianças menores,\r\nreposicionáveis e removíveis acompanhando o crescimento, juntamente com o apoio\r\nde cabeça ajustável em altura, cinto de 5 pontos com protetores acolchoados e\r\napoio de braços, transforma-se em assento de elevação para os maiores a partir\r\ndo grupo 3.<o:p></o:p></p>','1 a 10 anos',100.00,'36',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 14:56:07','2024-07-19 18:35:04','2024-07-19 18:35:04'),
(40,'Cadeirinha de Automóvel Holiday FX Black Intense Infanti','cadeirinha-de-automovel-holiday-fx-black-intense-infanti-40',9,'Infanti','<p class=\"MsoNormal\">Almofadas internas para reduzir o espaço, aumentam o\r\nconforto e segurança no posicionamento das crianças menores, com espuma extra\r\nremovível na região do assento, permitindo um ajuste que acompanhe o\r\ncrescimento do seu filho. Conforme o tempo passa, além de reverter o assento, o\r\najuste da altura do apoio de cabeça em conjunto com os cintos internos da\r\nHoliday, torna esta tarefa muito mais simples, até o momento em que seu filho\r\ncomece a usar os cintos do carro sobre a cadeirinha, isso significa um longo\r\ntempo de uso para este produto. Vamos lá sair de casa - passeios, viagens,\r\nférias e todos os momentos em que seja necessário se deslocar, serão mais\r\nagradáveis e seguros com a escolha da cadeirinha certa para todas as fases do\r\nseu filho. Aprovada pelo Inmetro para uso do nascimento aos 36 kg!<o:p></o:p></p>',NULL,100.00,'36',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 15:05:10','2024-07-19 18:35:47','2024-07-19 18:35:47'),
(41,'Berço Next2Me Pearl - Chicco','berco-next2me-pearl-chicco-41',10,'Chicco','<p class=\"MsoNormal\">O Berço Portátil - Next2Me - Pearl - Chicco oferece uma\r\ntransição suave do útero para o ambiente externo, promovendo conforto e\r\nsegurança desde os primeiros meses. Projetado para fortalecer o vínculo entre\r\npais e bebê, facilita a amamentação e promove noites tranquilas. Sua instalação\r\njunto à cama dos pais é simples e segura, permitindo fácil acesso para cuidados\r\nnoturnos. Com colchão macio e janela em rede para circulação de ar, é indicado\r\npara bebês até 9 kg. Possui rodas giratórias com freios, facilitando o\r\ntransporte e pode ser inclinado em até duas posições para maior conforto,\r\nreduzindo refluxo e congestão nasal. Após a utilização, pode ser facilmente\r\nmovido para outros ambientes, garantindo o conforto ideal em todos os momentos\r\ndo dia.<o:p></o:p></p>',NULL,100.00,'9',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 15:19:00','2024-07-19 18:35:51','2024-07-19 18:35:51'),
(42,'Colchão Berço Portátil Impermeável','colchao-berco-portatil-impermeavel-42',10,'Luckspuma','<p>Possui tecido anti-alérgico, tratamento anti-ácaro e bactérias. Espuema com densidade 18, á mais recomendada para colchões de berço, proporcionando suporte ideal para o sono do seu bebê. Possui revestimento plástico em uma face para proteção anti-vazamento.</p><p>Compativel com os Berços:</p><p>- Berço Portátil Angel | Burigotto</p><p>- Berço DayDream | MultiKids</p><p>- Berço Fit | Voyage</p><p>Construído com espuma de poliuretano. Este tipo de material faz com que a posição adotada pelo corpo seja ergonômica e permite que o peso seja distribuído sobre a superfície de forma equilibrada. Sua composição de anti-ácaros, o tecido grosso deste produto evita que os ácaros da poeira entrem em contato com a pele.            \r\n        </p>',NULL,100.00,NULL,NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 15:35:21','2024-07-19 18:35:54','2024-07-19 18:35:54'),
(43,'Colchão Berço Portátil Soneca Bee','colchao-berco-portatil-soneca-bee-43',10,'Bee','<p>Colchonete composto em material 100% espuma de poliuretano de alta performance que traz muito conforto para o seu bebê. Sua capa é composta em malha 100% algodão para maior conforto e aconchego do seu bebê.</p><p>- Compatível com Berço: Mini Play | Safety 1st.            \r\n        </p>',NULL,100.00,NULL,NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 16:12:42','2024-07-19 18:34:59','2024-07-19 18:34:59'),
(44,'Berço Portátil Mini Play Grey','berco-portatil-mini-play-grey-44',10,'Safety 1st','Leve, compacto e confortável para o bebê. Com rodas para movimentação laterais, com tela arejada, bolsa de transporte com alça e mosquiteiro. Bolso porta-objetos removível e reposicionável. Colchonete macio e com 2 posições de altura preso com zíper conforme os padrões de segurança mais modernos, que elimina espaços indesejados, evita acidentes e protege o bebê.','0 a 2 anos',100.00,'15',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 16:30:57','2024-07-19 18:35:57','2024-07-19 18:35:57'),
(45,'Berço Portátil Fit - Voyage','berco-portatil-fit-voyage-45',10,'Voyage','Prático para o dia a dia dos pais, possui colchonete com regulagem de 2 alturas para ser usado como berço ou cercadinho, acompanhando mosquiteiro. Leve, compacto e seguro para o bebê, com rodas para movimentação, laterais com tela e bolsa de transporte com alça, excelente para viagens. Aprovado pelo INMETRO conforme a norma ABNT NBR 15.860 para crianças do nascimento aos 15kg.',NULL,100.00,'15',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 16:49:03','2024-07-19 18:35:41','2024-07-19 18:35:41'),
(46,'Berço Portátil Cercadinho Preto Serenata Burigotto','berco-portatil-cercadinho-preto-serenata-burigotto-46',10,'Burigotto','<div>Garanta o máximo de conforto e segurança para o seu bebê com o Berço Serenata da Burigotto. Projetado com excelência, esse berço é o sonho de qualquer mãe preocupada com o bem-estar do seu pequeno. Com design moderno e elegante, o Serenata se destaca pela sua durabilidade e praticidade.</div><div>Com uma base regulável em duas alturas, adaptável ao crescimento do seu bebê, você poderá ajustar a altura do colchão de acordo com a idade e as necessidades dele. Além disso, o berço possui um espaçoso compartimento de armazenamento na parte inferior, perfeito para guardar os itens essenciais do seu bebê, mantendo tudo organizado e ao alcance das mãos.</div>',NULL,100.00,'15',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 17:08:26','2024-07-19 18:35:33','2024-07-19 18:35:33'),
(47,'Moisés Berço Portátil Com Balanço Comfy Maxi Baby','moises-berco-portatil-com-balanco-comfy-maxi-baby-47',10,'Maxi Baby','<div>O berço moisés portátil Comfy da Maxi Baby Feito em estrutura de alumínio leve, porém resistente. Fácil de montar e desmontar. A soneca do seu bebê com conforto onde você estiver!</div><div><br></div><div>Ideal para crianças de 0 à 9 meses, 2 funções (fixa ou balanço), com fechamento compacto que cabe em todos os cômodos da casa.</div><div>Laterais com tela arejada para evitar sufocamento do bebê, e um colchoado macio removível que facilita na limpeza.</div>','0 a 9 meses',100.00,'9',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 17:15:20','2024-07-19 18:35:30','2024-07-19 18:35:30'),
(48,'Berço Techno Portátil 4 Em 1 Com Bluetooth Mastela','berco-techno-portatil-4-em-1-com-bluetooth-mastela-48',10,'Mastela','<div>O Berço Techno Bluetooth é o mais completo do mercado com sua função automática, opção de acoplar na cama e muito mais. Ele é recomendado desde RN até 13,600Kg. Possui 5 velocidades de balanço, timer de 15, 30 e 45 minutos e após inatividade por 60 minutos ele desliga automaticamente. O BerçoTechno é versátil, possui duas alturas reguláveis, o cesto pode ser removido, transformando-o em um Moisés. A lateral abaixa possibilitando que o berço seja acoplado à cama dos pais. A capota acompanha móbile de brinquedos em plush e mosquiteiro acoplado. A base possui rodinhas com trava de segurança e pés antiderrapantes.</div><div><br></div><div>Possui painel de controle Touch Screen, interação por controle remoto e bluetooth dando a opção de colocar uma playlist personalizada para o bebê. Possui 15 melodias.</div>','o a 2 anos',100.00,'14',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 17:23:59','2024-07-19 18:35:26','2024-07-19 18:35:26'),
