(50,'Carrinho de Bebê Essential Eva - Maxi Cosi','carrinho-de-bebe-essential-eva-maxi-cosi-50',7,'Maxi-Cosi','<div>Suspensão nas 4 rodas. Fechamento prático, com apenas uma mão. Rodas com amortecedores, freio e giro 360° com trava de movimento nas rodas dianteiras. Capota com visor magnético, aba de sol rebatível e proteção UV50+. Aceito como bagagem de mão na maioria das companhias aéreas (*consulte a cia aérea antes de embarcar).<br></div>',NULL,100.00,'22',NULL,NULL,NULL,NULL,NULL,'ativo','2024-06-28 18:06:48','2024-07-19 18:35:22','2024-07-19 18:35:22'),
(51,'Berço Side By Side Bed Link Cinza','berco-side-by-side-bed-link-cinza-51',10,'Voyage','<p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">Co-bed com abertura lateral e tiras para acoplar à cama também pode ser usado com a lateral fechada, em qualquer lugar.</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\"> O Co-bed Link da Voyage possui colchonete macio e confortável, laterais com zíper para abertura fácil e tiras de segurança para se acoplar à cama, 7 posições de regulagem de altura e pés retráteis, com rodinhas e freio para deslocar o berço para outros lugares da casa com facilidade, quando estiver usando fechado. </span></p><p><span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">P</span><span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small; background-color: var(--bs-card-bg); text-align: var(--bs-body-text-align);\">raticidade também na limpeza com a capa que poder ser removida para lavar.&nbsp;</span></p>','0 a 2 anos',1.00,'15',NULL,'<div>O Berço garante noites mais confortáveis para toda a família!</div><div><br></div><div>O design versátil permite que ele seja facilmente acoplado na cama dos adultos através de tiras que envolvem o colchão e mantém o berço fixo e seguro. </div><div><br></div><div>Além de promover a convivência de pais e filhos com mais segurança no conceito de cama compartilhada (co-beding), também traz maior facilidade para a amamentação noturna, melhora a qualidade do sono e possibilita tranquilizar rapidamente o bebê durante a noite.</div><div><br></div><div>É muito fácil de montar e desmontar, por isso, pode ser usado como um prático berço portátil em qualquer ambiente. </div><div><br></div><div>Oferece&nbsp; ajustes de altura e ajuste de inclinação antirrefluxo.</div><div><br></div><div> Ainda acompanha bolsa para transporte, mosquiteiro e colchonete macio.</div>',NULL,NULL,NULL,'ativo','2024-07-16 20:08:43','2024-07-19 18:35:17','2024-07-19 18:35:17'),
(56,'Carrinho de bebê Eva Maxi Cosi','carrinho-de-bebe-eva-maxi-cosi-56',7,'Maxi - Cosi','<div>O Carrinho Eva da Maxi Cosi é compacto e com fechamento automático rápido com apenas uma das mãos,&nbsp;<span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\">garantindo</span></div><div><span style=\"background-color: var(--bs-card-bg); font-size: var(--bs-body-font-size); text-align: var(--bs-body-text-align);\"> toda praticidade que a vida moderna e agitada exige.</span></div><div><br></div><div>Para os Pais que precisam de praticidade sem abrir mão do conforto do bebê.</div><div><br></div><div>O carrinho Eva foi desenvolvido para acompanhar o seu bebê perfeitamente em todas as fases, sendo também um excelente carrinho de passeio para as crianças maiores, para ser usado por longos anos já que suporta até 22kg.</div>','0 - 24 meses',35.00,'22kg',NULL,'<div>Principais Características do Carrinho Eva:</div><div><br></div><div>- Leve e com alça de ombro para carregar;</div><div>- Fechamento automático, com apenas 1 mão;</div><div>- Assento com múltiplas posições de inclinação;</div><div>- Capota com visor, aba de sol rebatível e proteção UV50+;</div><div>- Assento com inclinação total para uso desde recém nascido;</div><div>- Cesto porta objetos espaçoso com capacidade para 5kg extras;</div><div>- Amortecedores nas 4 rodas, freios, e rodas dianteiras com giro 360°;</div>',NULL,NULL,70,'ativo','2024-07-19 20:30:56','2024-09-16 10:44:21',NULL),
