 rgb(69, 43, 122); clear: right; font-family: Kanit, sans-serif;\"><br style=\"border: 0px; margin: 0px; padding: 0px; outline: none; color: rgb(69, 43, 122); clear: right; font-family: Kanit, sans-serif;\"><span style=\"color: rgb(69, 43, 122); font-family: Kanit, sans-serif;\">Peso do Produto 10,9 Kg</span><br style=\"border: 0px; margin: 0px; padding: 0px; outline: none; color: rgb(69, 43, 122); clear: right; font-family: Kanit, sans-serif;\"><span style=\"color: rgb(69, 43, 122); font-family: Kanit, sans-serif;\">Dimensões Externa do Produto (A x L x P | cm) 76 x 70 x 100 cm</span>','36 meses',35.90,'10,9',NULL,NULL,NULL,NULL,NULL,'ativo','2024-07-22 14:23:58','2024-07-22 14:24:40','2024-07-22 14:24:40'),
(61,'Carrinho De Bebê Lucca','carrinho-de-bebe-lucca-61',7,'Infanti','<p><span style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px; background-color: var(--bs-card-bg); text-align: var(--bs-body-text-align);\">O carrinho de passeio serve para bebês a partir dos 6 meses, quando as suas costas e pescoço já estão mais rígidos. </span></p><p><span style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px; background-color: var(--bs-card-bg); text-align: var(--bs-body-text-align);\">Reclina-se horizontalmente, permitindo um descanso seguro e confortável.</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\">Reclina-se facilmente em diferentes posições, permitindo que você acompanhe seu bebê nas diferentes etapas do dia a dia.</span>            \r\n        </p>','3 Anos',29.00,'15 kg',NULL,NULL,NULL,NULL,70,'ativo','2024-07-22 15:00:27','2024-07-24 12:42:12',NULL),
(62,'Cadeira de Auto Alfa Voyage','cadeira-de-auto-alfa-voyage-62',9,'Voyage','<p>Para crianças de 9kg até os 36kg, a cadeira Voyage Alfa é completa em todos os sentidos!</p><p> Para mantê-la bem acomodada, o equipamento vem com assento de elevação (booster), ajuste de altura do apoio de cabeça, para mudar de acordo com o crescimento do bebê, protetores de ombro, apoio para os braços, além de posições de inclinação.&nbsp; </p><p>Produto certificado pelo Inmetro!</p>','ate 9 anos',25.00,'36 Kg',NULL,'<p>Seja para pequenas ou longas viagens, garantir a segurança da criança no carro é essencial.</p><p> Com a Cadeira para Automóvel Voyage Alfa, você não só atende às exigências da lei de trânsito, como também proporciona o máximo conforto para seu pequeno!</p><p><strong>Segurança Completa:</strong> Totalmente em conformidade com as normas de trânsito.</p><p><strong>Conforto Premium:</strong> Design ergonômico para o bem-estar do bebê.</p><p><strong>Praticidade:</strong> Fácil instalação e ajuste para viagens tranquilas.</p>',NULL,NULL,72,'ativo','2024-07-22 15:10:13','2024-09-16 10:45:09',NULL),
(63,'Cadeira de auto Mundi  360 Infanti','cadeira-de-auto-mundi-360-infanti-63',9,'Infanti','<p><span style=\"color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\">&nbsp;A cadeira para Auto Infanti Mia 360 de 0 a 36kg é um super lançamento que une segurança e tecnologia em prol de um crescimento mais saudável para os pequenos. </span></p><p><span style=\"color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\">Possui giro 360 que facilita para colocar ou retirar a criança do carro, podendo ser feita livremente quando ela está instalada de costas ao movimento e, quando está de frente, tem um diferencial: uma fivela no Top Tether permite uma desconexão temporária para que o giro seja feito.</span></p><p><span style=\"color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\"> A instalação feita com o isofix evita erros e garante 100% de segurança, exibindo sinalização verde ou vermelha como orientação. Possui 5 posições de inclinação e ajuste de altura simultâneo do apoio de cabeça e cinto de segurança, este que possui 5 pontos e protetores acolchoados. </span></p><p><span style=\"color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\">Além disso, a Mia possui um alarme sonoro que avisa quando é necessário que algum ajuste seja feito: apita quando os cintos de segurança são abertos e quando a fivela top tether não está devidamente fixada, facilitando o manuseio dos pais e prezando pela máxima segurança dos pequenos.&nbsp;</span>            \r\n        </p>','Crianças até  a 150cm',29.00,'36kg',NULL,NULL,NULL,NULL,72,'inativo','2024-07-22 16:32:21','2024-09-12 16:02:39',NULL),
(64,'Booster Starfix Infanti Preto','booster-starfix-infanti-preto-64',9,'Infanti','<p><span style=\"color: rgb(87, 87, 87); font-family: Nunito, Arial, sans-serif, -apple-system, BlinkMacSystemFont, Helvetica, &quot;Apple Color Emoji&quot;; font-size: medium;\">Com o Booster Starfix Infanti, você tem a combinação perfeita de segurança, conforto e diversão. </span></p><p><span style=\"color: rgb(87, 87, 87); font-family: Nunito, Arial, sans-serif, -apple-system, BlinkMacSystemFont, Helvetica, &quot;Apple Color Emoji&quot;; font-size: medium;\">Muito mais moderno, possui detalhes diferenciados, tecido especial e mais espaço no assento, feito para acomodar super bem as crianças até os 10 anos de idade.</span><br style=\"border-width: 0px; border-style: solid; border-color: rgb(231, 231, 231); color: rgb(87, 87, 87); font-family: Nunito, Arial, sans-serif, -apple-system, BlinkMacSystemFont, Helvetica, &quot;Apple Color Emoji&quot;; font-size: medium;\"><br style=\"border-width: 0px; border-style: solid; border-color: rgb(231, 231, 231); color: rgb(87, 87, 87); font-family: Nunito, Arial, sans-serif, -apple-system, BlinkMacSystemFont, Helvetica, &quot;Apple Color Emoji&quot;; font-size: medium;\"><span style=\"color: rgb(87, 87, 87); font-family: Nunito, Arial, sans-serif, -apple-system, BlinkMacSystemFont, Helvetica, &quot;Apple Color Emoji&quot;; font-size: medium;\">A instalação pode ser feita apenas com os cintos do veículo ou em conjunto com os ganchos Isofix, possui apoio de braços elevado e guia de segurança para auxiliar no posicionamento correto dos cintos do carro, dando tranquilidade aos pais de que seus filhos estão confortáveis e seguros durante todo o passeio.</span>            \r\n        </p>','crianças até os 10 anos de idade.',19.00,'36 kg',NULL,'<p><span style=\"color: rgb(87, 87, 87); font-family: Nunito, Arial, sans-serif, -apple-system, BlinkMacSystemFont, Helvetica, &quot;Apple Color Emoji&quot;; font-size: medium;\">Por que escolher o Assento de 