(65,'Triciclo Patroller','triciclo-patroller-65',7,'Maxi - Cosi','<p><span style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\">O Triciclo Patroller proporciona muita diversão e mobilidade para os pequenos aventureiros, aonde quer que desejem explorar. </span></p><p><span style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\">Com 6 diferentes modos de uso, ele acompanha o crescimento e a independência da criança, tornando-se um produto versátil e durável.</span><br style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\"><br style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\"><span style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\">Seu design moderno e sofisticado, com logo metalizado, tecido premium e bordados exclusivos, adicionam um toque especial aos momentos de passeio. Saiba mais sobre este modelo que faz parte da linha Luxe da Maxi-Cosi.</span><br style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\">            \r\n        </p>','Para crianças acima dos 12 meses',35.00,'25 kg',NULL,'<div class=\"ui-pdp-container__row ui-pdp-container__row--description\" id=\"description\" style=\"display: flex; flex: 0 1 auto; flex-flow: wrap; border-top: 1px solid rgba(0, 0, 0, 0.1); padding-bottom: 40px; padding-top: 40px; font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif;\"><div class=\"ui-pdp-collapsable ui-pdp-description-collapse\" style=\"width: 718px;\"><div class=\"ui-pdp-collapsable__container\"><div class=\"ui-pdp-description\" style=\"color: rgba(0, 0, 0,