(72,'Protetor Solar Retrátil Black','protetor-solar-retratil-black-72',15,'Safety 1st','<p><span style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\">Dias quentes e ensolarados são um convite para passeios, mas ao transportar as crianças no carro, precisamos ter toda atenção e cuidado com todos os detalhes. </span></p><p><span style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\">Para isso o Protetor Solar Retrátil da Safety 1st é um acessório indispensável. </span></p><p><span style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\">Fácil de instalar, basta pressionar as ventosas no vidro e com seu botão para retração rápida, recolha quando quiser, sem precisar desinstalar o produto.</span></p><p><span style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\"><br></span><br style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\"><span style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\">Para proteção da incidência direta dos raios solares ou mesmo para reduzir o excesso de luminosidade durante aquela agradável soneca, o Protetor Solar Retrátil Safety 1st estará sempre à mão.</span><br style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\"></p>',NULL,5.00,NULL,NULL,NULL,NULL,NULL,63,'inativo','2024-07-22 19:52:47','2024-09-12 16:02:55',NULL),
(73,'Mosquiteiro SafeNap Safety 1st - White','mosquiteiro-safenap-safety-1st-white-73',15,'Internet','<span style=\"color: rgb(102, 102, 102); font-family: &quot;Proxima Nova&quot;, -apple-system, Roboto, Arial, sans-serif; font-size: 20px;\">Este mosquiteiro é compatível com a maioria dos carrinhos e berços, tornando-o um item essencial para o conforto e segurança do seu pequeno.</span>',NULL,5.00,NULL,NULL,'<p>Imagem meramente ilustrativa.</p><p> Produtos podem variar conforme a região e disponibilidade.            \r\n        </p>',NULL,NULL,69,'ativo','2024-07-22 20:04:05','2024-07-24 13:03:45','2024-07-24 13:03:45'),
(74,'Plataforma Universal para Carrinho de Passeio','plataforma-universal-para-carrinho-de-passeio-74',15,NULL,'<span style=\"color: rgb(55, 65, 81); font-family: ui-sans-serif, system-ui, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; white-space-collapse: preserve-breaks;\">ssa é uma plataforma de passeio mais avançada pode acomodar com segurança crianças com até 22kg! Pode se adaptar ao crescimento de crianças pequenas e pode ser instalado no frontal ou traseira do carrinho de bebê.\r\n\r\nAs duas bielas podem ser selecionadas para reduzir ou expandir a distância de acordo com diferentes larguras de carrinho, chegando á distância máxima de 33cm, garantindo uma conexão estável.\r\n\r\nCom metodo 2 em 1 adota métodos de conexão avançados, que podem ser usados de forma flexível com diferentes modelos de carrinhos de bebê.\r\n\r\nO assento é destacável e pode ser facilmente fechado e aberto, para que as crianças possam escolher a posição sentada ou em pé.</span>',NULL,19.00,NULL,NULL,NULL,NULL,NULL,61,'ativo','2024-07-22 20:30:14','2024-09-18 12:42:20',NULL),
(75,'Carrinho Camping','carrinho-camping-75',7,'Internet','<span style=\"color: rgba(0, 0, 0, 0.8); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, 文泉驛正黑, &quot;WenQuanYi Zen Hei&quot;, &quot;Hiragino Sans GB&quot;, &quot;儷黑 Pro&quot;, &quot;LiHei Pro&quot;, &quot;Heiti TC&quot;, 微軟正黑體, &quot;Microsoft JhengHei UI&quot;, &quot;Microsoft JhengHei&quot;, sans-serif; font-size: 14px; white-space-collapse: preserve;\">É um modelo indispensável para as suas aventuras, seja ela no camping, praia ou mesmo em sua casa!</span>',NULL,35.00,NULL,NULL,'<span style=\"color: rgba(0, 0, 0, 0.8); font-family: Roboto, &quot;Helvetica Neue&quot;, Helvetica, Arial, 文泉驛正黑, &quot;WenQuanYi Zen Hei&quot;, &quot;Hiragino Sans GB&quot;, &quot;儷黑 Pro&quot;, &quot;LiHei Pro&quot;, &quot;Heiti TC&quot;, 微軟正黑體, &quot;Microsoft JhengHei UI&quot;, &quot;Microsoft JhengHei&quot;, sans-serif; font-size: 14px; white-space-collapse: preserve;\">Prático e fácil de usar, possui bolsa em lona removível e conta com estrutura dobrável que facilita o armazenamento, ocupando pouco espaço.\r\n&nbsp;\r\nCarrinho dobrável com bolsa de transporte\r\n• Estrutura sólida e resistente\r\n• Amplo espaço para carregar seus equipamentos\r\n&nbsp;\r\nConheça o novo carrinho dobrável !</span>',NULL,NULL,65,'inativo','2024-07-23 18:14:11','2024-09-13 14:23:59',NULL),
(76,'Mosquiteiro SafeNap Safety 1st - White','mosquiteiro-safenap-safety-1st-white-76',15,'Safety 1st','<span style=\"color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\">Com arcos para elevação, é muito mais prático para encaixar. Protege o sono e as brincadeiras do bebê e dá tranquilidade aos pais. Compatível com a maioria dos berços portáteis do mercado.</span><br style=\"margin: 0px; padding: 0px; outline: 0px; color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\"><br style=\"margin: 0px; padding: 0px; outline: 0px; color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\">A hora do soninho ou mesmo das brincadeiras no berço portátil merecem cuidados especiais e toda atenção necessária principalmente com os indesejáveis insetos. Assim, o mosquiteiro avulso SafeNap da Safety1st é um acessório essencial no dia a dia dos pais.</span><br style=\"margin: 0px; padding: 0px; outline: 0px; color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\"><br style=\"margin: 0px; padding: 0px; outline: 0px; color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\">Os bebês ficam muito mais protegidos e a abertura parcial sem remover permite atender as necessidades do seu filho muito mais rapidamente. Os arcos proporcionam um ambiente arejado e seguro e é fácil de instalar com os ganchos de encaixe rápido nas laterais. Lavável à mão.</span><br style=\"margin: 0px; padding: 0px; outline: 0px; color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\"><br style=\"margin: 0px; padding: 0px; outline: 0px; color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\"><span style=\"color: rgb(64, 64, 64); font-family: Roboto, sans-serif; text-align: justify;\">Compatível com a maioria dos berços portáteis do mercado com medidas entre: Largura: 70 cm e 85 cm Comprimento: entre 100 cm e 110 cm.</span>',NULL,5.00,NULL,NULL,NULL,NULL,NULL,69,'inativo','2024-07-23 18:33:28','2024-09-12 16:04:17',NULL);
